import { css } from '@emotion/core';

export const navContainerStyle = css``;

export const ulStyle = css`
  display: flex;
  flex: 1;
  justify-content: space-between;
  align-items: center;
`;

export const fileUpload = css`
  display: none;
`;

export const buttonStyle = css`
  display: flex;
`;
